import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
  const carLogos = [
    "https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/Toyota_logo.svg/512px-Toyota_logo.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/3/3d/BMW_logo_%28gray%29.svg/512px-BMW_logo_%28gray%29.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Mercedes-Benz_logo_2010.svg/512px-Mercedes-Benz_logo_2010.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/e/e3/Audi_logo_%282023%29.svg/512px-Audi_logo_%282023%29.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/3/37/Volkswagen_logo_2019.svg/512px-Volkswagen_logo_2019.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/5/5f/Ford_Motor_Company_Logo.svg/512px-Ford_Motor_Company_Logo.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/9/9f/Honda_logo.svg/512px-Honda_logo.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Nissan_logo.svg/512px-Nissan_logo.svg.png"
  ];

  const CarBrands = () => {
    return (
      <div
        style={{
          overflow: "hidden",
          whiteSpace: "nowrap",
          position: "relative",
          width: "100%",
          backgroundColor: "#f8f9fa",
          padding: "10px 0"
        }}
      >
        <div
          style={{
            display: "flex",
            animation: "scroll 15s linear infinite"
          }}
        >
          {[...carLogos, ...carLogos].map((logo, index) => (
            <img
              key={index}
              src={logo}
              alt="Car Logo"
              style={{ width: "80px", height: "auto", margin: "0 20px" }}
            />
          ))}
        </div>
        <style>
          {`
            @keyframes scroll {
              from {
                transform: translateX(0);
              }
              to {
                transform: translateX(-50%);
              }
            }
          `}
        </style>
      </div>
    );
  };
export default CarBrands;
